                        newMeshes[i].rotationQuaternion = BABYLON.Quaternion.RotationYawPitchRoll(newMeshes[i].rotation.y, newMeshes[i].rotation.x, newMeshes[i].rotation.z);
                        newMeshes[i].rotation = BABYLON.Vector3.Zero();
                        newMeshes[i].scaling = new BABYLON.Vector3(2, 2, 2);
                        newMeshes[i].position = new BABYLON.Vector3.Zero();
                        if (newMeshes[i].name == "earth") {
                            newMeshes[i].material = shaderMaterial;
                            earth = newMeshes[i];
                        } else if (newMeshes[i].name == "plan1") {
                            newMeshes[i].material = materialplan;
                            planone = newMeshes[i];
                            planone.setParent(ground);
                        } else if (newMeshes[i].name == "plan2") {
                            plantwo = newMeshes[i];
                            plantwo.material = materialplan;
                        }
                    }
                }
            });

            function onValueChanged(value) {
                var val = 1 - value / 2;
                ground.rotation.y = 1 / 180 * val * 360 * Math.PI;
                shaderMaterial.setVector3("planrotation2", groundtwo.getFacetNormal(1));
                shaderMaterial.setFloat("Rotation", val * 360);
            }

            var showearthinner = false;

            var alpha = 0;

            var gototargetpos = false;
            var gotocamerapos = false;

            var targetpos = new BABYLON.Vector3(0, 0, 0);
            var camerapos = camera.position;

            var targetstartpos = new BABYLON.Vector3(0, 0, 0);
            var camerastartpos = new BABYLON.Vector3(camera.position.x, camera.position.y, camera.position.z);
            var targetendpos = new BABYLON.Vector3(-4.5, 4.5, 0);
            var cameraendpos = new BABYLON.Vector3(-4.5, 4.5, -6.5);
            var showhidestone = false;
            var stonebtn = true;

            function stoneshow() {
                stonebtn = false;

                camera.detachControl(canvas);
                gototargetpos = true;
                camera.lowerRadiusLimit = 0;
                camera.upperRadiusLimit = 20;
            }
            function stonehide() {
                stonebtn = false;
                gotocamerapos = true;
            }

            var showhide = false;
            function lineshow() {
                planone.isVisible = false;
                plantwo.isVisible = false;
                groundimage1.isVisible = true;
            }
            function linehide() {
                planone.isVisible = true;
                plantwo.isVisible = true;
                groundimage1.isVisible = false;
            }

            var check = function() {
                if (showhide) {
                    $('#checkd2').children('span').css('background', '#F0F0F0').children().css({ 'left': '2px', 'right': 'auto' });
                    showhide = false;
                    linehide();
                } else {
                    $('#checkd2').children('span').css('background', '#5CAEFD').children().css({ 'right': '2px', 'left': 'auto' });
                    showhide = true;
                    lineshow();
                }
            };
            var reset = function() {
                stonebtn = true;
                gototargetpos = false;
                gotocamerapos = false;
                alpha = 0;
                showearthinner = false;
                showhide = false;
                $('#showhide').hide();
                $('#image').hide();
                camera.setTarget(targetstartpos);
                camera.setPosition(camerastartpos);
                camerapos = camerastartpos;
                targetpos = targetstartpos;
                camera.attachControl(canvas, false);
                showhidestone = false;
                linehide();
                onValueChanged(0);
                camera.lowerRadiusLimit = 20;
                camera.upperRadiusLimit = 20;
                showearthinnerfuntrue = true;
                 $('.addB').css({ color: "#000", background: "#fff" });
                $('#checkd2').children('span').css('background', '#F0F0F0').children().css({ 'left': '2px', 'right': 'auto' });
                $('#checkd1').children('span').css('background', '#F0F0F0').children().css({ 'left': '2px', 'right': 'auto' });
            };
            var showhidestonefunc = function() {
                if (stonebtn) {
                    if (showhidestone) {
                        $('#checkd1').children('span').css('background', '#F0F0F0').children().css({ 'left': '2px', 'right': 'auto' });
                        stonehide();
                        showhidestone = false;
                    } else {
                        $('#checkd1').children('span').css('background', '#5CAEFD').children().css({ 'right': '2px', 'left': 'auto' });
                        stoneshow();
                        showhidestone = true;
                    }
                }
            }
            var showearthinnerfuntrue = true;
            var showearthinnerfun = function() {
                if (showearthinnerfuntrue) {
                    showearthinner = true;
                    $('.addB').css({ 'background': '#5CAEFD', color: "#fff" });
                    showearthinnerfuntrue = false;
                } else {
                    showearthinnerfuntrue = true;
                    reset();
                }
            };

            if (this.isMob) {
                $('#checkd2').on('touchstart', check);
                $('#reset').on('touchstart', reset);
                $('#checkd1').on('touchstart', showhidestonefunc);
                $('.addB').on('touchstart', showearthinnerfun);
            } else {
                $('#checkd2').on('click', check);
                $('#reset').on('click', reset);
                $('#checkd1').on('click', showhidestonefunc);
                $('.addB').on('click', showearthinnerfun);
            }
            var smooth=0.25;
            scene.registerBeforeRender(function() {
                if (showearthinner == true && alpha < 1.02) {
                    onValueChanged(alpha);
                    alpha += 0.02;
                    if (alpha >= 1.02) {
                        $('#showhide').show();
                    }
                }

                if (gototargetpos == true) {
                    targetpos = BABYLON.Vector3.Lerp(targetpos, targetendpos, smooth);
                    camerapos = BABYLON.Vector3.Lerp(camerapos, cameraendpos,smooth);
                    camera.setTarget(targetpos);
                    camera.setPosition(camerapos);
                }
                if (BABYLON.Vector3.Distance(targetpos, targetendpos) < 0.000001
                    && BABYLON.Vector3.Distance(camerapos, cameraendpos) < 0.000001 && gototargetpos == true) {
                    gototargetpos = false;
                    stonebtn = true;

                    $('#image').show();
                    console.log("targetendpos");
                }
                if (gotocamerapos == true) {
                    targetpos = BABYLON.Vector3.Lerp(targetpos, targetstartpos, smooth);
                    camerapos = BABYLON.Vector3.Lerp(camerapos, camerastartpos, smooth);
                    camera.setTarget(targetpos);
                    camera.setPosition(camerapos);
                }
                if (BABYLON.Vector3.Distance(camerapos, camerastartpos) < 0.000001 &&
                    BABYLON.Vector3.Distance(targetpos, targetstartpos) < 0.000001 && gotocamerapos == true) {
                    console.log("targetstartpos");
                    stonebtn = true;
                    gotocamerapos = false;
                    camera.attachControl(canvas, false);
                    camera.lowerRadiusLimit = 20;
                    camera.upperRadiusLimit = 20;
                    $('#image').hide();
                }
            });
            return scene;
        }
    },
    mounted() {
        this.init();
        $('#showhide').hide();
    }
}
</script>

